  /**
   * Code to generate the code above from a current list of contributors
   */
  def dumpContributors(contributors: Contributors) = {
    def option(s: Option[String]) = s.fold("None")("Some(\"" + _ + "\")")
    def contributor(c: Contributor): String =
      s"""Contributor(url = "${c.url}", login = "${c.login}", link = "${c.link}", gravatar = ${option(c.gravatar)}, contributions = ${c.contributions}, isPlay2 = ${c.isPlay2})"""

    val core = contributors.core.map { c =>
      s"""
      |        CoreContributor(
      |          url = "${c.url}",
      |          login = "${c.login}",
      |          name = ${option(c.name)},
      |          link = "${c.link}",
      |          gravatar = ${option(c.gravatar)},
      |          bio = ${c.bio.fold("None")("Some(\"\"\"" + _ + "\"\"\")")}
      |        )""".stripMargin
    }.mkString(",")

    val orgs = contributors.organisationBased.map { org =>

      val orgMembers = org._2.map(m => "            " + contributor(m)).mkString(",\n")

      s"""
      |        Organisation(id = "${org._1.id}", name = "${org._1.name}", url = "${org._1.url}", blessed = ${org._1.blessed}) ->
      |          List(
      |$orgMembers
      |          )""".stripMargin
    }.mkString(",")

    val others = contributors.others.map(c => "        " + contributor(c)).mkString(",\n")

    s"""
      |    Contributors(
      |      core = List(
      |$core
      |      ),
      |      organisationBased = SortedMap(
      |$orgs
      |      ),
      |      others = List(
      |$others
      |      )
      |    )""".stripMargin
  }


